import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Form from '.'
import styled from 'styled-components';

export default function AllForms({ forms, setForms }) {
  console.log(forms);
  return (
    <Container>
      {forms.map((form) => {
        return <Form key={form._id} />;
      })}
    </Container>
  );
}

const Container = styled.div`
  height: 100%;
  background: lime;
`;
